import React from "react";
import { useParams } from "react-router-dom";

const Ordered = () => {
  const { id } = useParams();

  return (
    <div className="container">
      <div className="row mt-3">
        <div className="col s12 m6" style={{ margin: "0 auto" }}>
          <div className="card">
            <div className="card-content white-text">
              <img
                className="card-title black-text"
                src="https://cdn.paycom.uz/documentation_assets/power-by-Payme.svg"
                alt="payme"
                height={"100px"}
              />
              <p>Введите сумму для пополнения счета через систему «Payme»</p>
              <p>
                <div class="row">
                  <div class="input-field col s12">
                    <input
                      min={1000}
                      id="number"
                      type="number"
                      class="validate"
                    />
                    <label for="number">Введите сумму (мин. 1000)</label>
                  </div>{" "}
                </div>
              </p>
            </div>
            <div className="card-action">
              <a href="#">Заплатить</a>
              <a href="#">Отменить</a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Ordered;
